# -*- coding: utf-8 -*-


class Solution:
    def dailyTemperaturesWithStack(self, T):
        ans = [0] * len(T)
        stack = [] #indexes from hottest to coldest
        for i in range(len(T) - 1, -1, -1):
            while stack and T[i] >= T[stack[-1]]:
                stack.pop()
            if stack:
                ans[i] = stack[-1] - i
            stack.append(i)
        return ans

    def dailyTemperatures(self, T):
        r = [0] * len(T)
        i = 0
        c = 0
        while i < len(T):
            c += 1
            t = {T[i]: [i]}
            for j in range(i + 1, len(T)):
                tmp = {}
                for k, idx_list in t.items():
                    if k < T[j]:
                        for idx in idx_list:
                            r[idx] = j - idx
                    else:
                        tmp[k] = idx_list
                t = tmp
                if t:
                    if T[j] not in t:
                        t[T[j]] = []
                    t[T[j]].append(j)
                else:
                    break
                i += 1
            i += 1
        return r


